import './App.css';

function App() {
    return (
        <div className="App">
            <TodoList/>
            <TodoList/>
            <TodoList/>
        </div>
    );
}

const TodoList = () => {
    return (
        <div>
            <h3>What to learn</h3>
            <div>
                <input />
                <button>+</button>
            </div>
            <ul>
                <li><input type="checkbox" checked={true}/><span>CSS & HTML</span></li>
                <li><input type="checkbox" checked={true}/><span>JavaScript</span></li>
                <li><input type="checkbox" checked={false}/><span>React</span></li>
            </ul>
        </div>
    )
}
export default App;
